import { Badge, Grid, GridItem, Text } from "@chakra-ui/react";
import React from "react";

function App() {
  return (
    <Grid
      templateAreas={`"header header"
                  "nav main"
                  "nav footer"`}
      gridTemplateRows={"200px 2fr 100px"}
      gridTemplateColumns={"660px 1fr"}
      h="880px"
      gap="1"
      color="blackAlpha.700"
      fontWeight="bold"
    >
      <GridItem pl="2" bg="orange.300" area={"header"}>
        <Badge variant="outline" colorScheme="#ff9999">
          <Text p={5} fontSize={"2xl"} fontWeight="bold">
            {" "}
            Tinder
          </Text>
        </Badge>
      </GridItem>
      <GridItem pl="2" bg="pink.300" area={"nav"}>
        Nav
      </GridItem>
      <GridItem pl="2" bg="green.300" area={"main"}>
        Main
      </GridItem>
      <GridItem pl="2" bg="blue.300" area={"footer"}>
        Footer
      </GridItem>
    </Grid>
  );
}

export default App;
